import React from 'react';
import './Main.css';

const Main = ({ matches }) => {
  return (
    <div className="main">
      <div className="main-buttons">
        {/* Buttons here if any */}
      </div>
      <ul className="matches-list">
        {matches.map((match) => (
          <li key={match.id} className="match-card">
            <h3>{match.team1} vs {match.team2}</h3>
            <p>{match.date}</p>
            <p>{match.venue}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Main;
